script: |
  super -f text -I q9150.spq | sort > q9150.out

inputs:
  - name: q9150.spq
    data: |
      SELECT ALL col2 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT col0 * - - 89 BETWEEN ( - 22 + col2 ) AND + col0;
  - name: tab2

outputs:
  - name: q9150.out
    data: |
      23
      40
      58
